import ExpenseDate from "./ExpenseDate";
import ExpenseDetails from "./ExpenseDetails";
import Card from "./Card";
function ExpenseItem(props){
    return (
      <Card className="expense-item">
        <ExpenseDate date={props.date}></ExpenseDate>
        {/* <ExpenseDetails title={props.title}></ExpenseDetails>
        <ExpenseDetails amount={props.amount}></ExpenseDetails>
        <ExpenseDetails location={props.location}></ExpenseDetails> */}
        {/* <div className="expense-item__description">
           <h2 className="expense-item h2">{props.title}</h2>
          <div className="expense-item__price">Rs.{props.amount}/-</div>
          <div className="expense-item__location">{props.location}</div> 
        </div> */}
        <div className="expense-item__description">
          <ExpenseDetails title={props.title}>{props.title}</ExpenseDetails>
          {/* <h2 className="expense-item h2"></h2> */}
        </div>
      </Card>
    );
}

export default ExpenseItem;
